column1:
제가 작년 12월에 창업인사이드라는 팟캐스트 라디오에 출연했었는데 몰랑이의 시작과 몰랑이 사업, 개인사업에 대한 여러가지 의견을 나누는 대화가 들어있어요~ 너무 늦게 올리네요;
조금이나마 도움이 되는 정보 받아가시기를 바라며 공유해봅니다:)
(1부)

중성화 하고 너무 힘들어하길래 걱정되ㅐ서강쥐카페에다가 새벽에 글 올렸더니 ‘저히 강아지는 금방 좋아지던데요’ ‘저히 애기는 몇 시간만에 팔짝 뛰어다녀요’
이러는 답변은 왜 쓰는거야 대체;;;;; 
아 예 어쩌라고요ㅗ ㅗ

내가 무단차 언제언제 갔나 생각해봤는데
18뱨어 뱩암 B열 사이드 나눔받아서 간 거랑
이쳔 애포베 3열 찐중앙 이렇게 두번이고;
이포베 갔다 집오는 길에 목에 칼이 들어와도 무단차 다신 안가겠다던 내 결심이 최쟤림 때문에 와르르 대벌엿음;
